import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();

    this.state = {

    monsters: [
      {
        name: 'Frankenstein',
        id: 'm1'
      },
      {
        name: 'Zombie',
        id: 'm2'
      },
      {
        name: 'Vampire',
        id: 'm3'
      }

    ]

    };
    }

   render() {
return (
        <div className="App">
          {
            this.state.monsters.map(monster => <h1>{monster.name}</h1>)
          }
          </div>
);
   }
}

export default App;
